import React from "react";
import './com.css';
import logo from '../Images/download.jpeg';

export default function NavBar(){
    return(
        <div className="nav-container" >
       
            <img src={logo} alt=""/>
         
           <div className="nav-icon">
                <div className="hamburger"></div>
            </div>
          
        </div>
   
       
    )
}
